Esta atribución corresponde al poeta cubano Julián del Casal (1863-1893), reconocido como uno de los principales representantes del Modernismo en Hispanoamérica. El poema "Anhelos" muestra claramente su estilo poético característico, con un lenguaje muy elaborado, sensual y con fuertes imágenes románticas y modernistas.
